from urllib.parse import urlparse

def extract_subdomain(url):
    try:
        netloc = urlparse(url).netloc
        parts = netloc.split('.')
        if len(parts) <= 3:
            return 'No subdomain present'
        else:
            return '.'.join(parts[:-2])
    except Exception as e:
        return str(e)

